import React from 'react';
import './Contact.css';

function ContactForm() {
    return (
        <div className="contact-form-container">
            <div className="contact-section-line"></div>
            <h3 className="contact-section-header">Contact</h3>
            <div className="contact-section-line"></div>
        </div>
    );
}

export default ContactForm;
